import Navbar from './Navbar'
import Banner from './Banner'
import Fhead from './Fhead'
import Products from './Products';
import Head2 from './Head2';
export default function App() {
  return <div>
      <Header />
      <Navbar />
      <Banner />
      <Fhead />
      <Products />
      <Head2/>
  </div>;
}
